import React, { isValidElement } from 'react';
import AliceCarousel from 'react-alice-carousel';
import { useRef } from 'react';
import 'react-alice-carousel/lib/alice-carousel.css';
import EventBox from './eventBoxes';


const items = [
  <EventBox
    eventName="Hack the box" 
    eventDescription="Sit in front of a box and pretend you know how to hack like you're mr.robot" 
    dpt="coding"
    time="2nd Nov 9:50"
  />,
 <EventBox 
    eventName="Relay Typing" 
    eventDescription="Pretend like you know how to code but you're just typing someone else's algorithm" 
    dpt="robotics"
    time="3rd Nov 1:00"
  />,
  <EventBox 
    eventName="Hack the box" 
    eventDescription="Sit in front of a box and pretend you know how to hack like you're mr.robot" 
    dpt="departmental"
    time="2nd Nov 9:50"
  />,
  <EventBox
    eventName="Hack the box" 
    eventDescription="Sit in front of a box and pretend you know how to hack like you're mr.robot" 
    dpt="coding"
    time="2nd Nov 9:50"
  />,
 <EventBox 
    eventName="Relay Typing" 
    eventDescription="Pretend like you know how to code but you're just typing someone else's algorithm" 
    dpt="robotics"
    time="3rd Nov 1:00"
  />,
  <EventBox 
    eventName="Hack the box" 
    eventDescription="Sit in front of a box and pretend you know how to hack like you're mr.robot" 
    dpt="departmental"
    time="2nd Nov 9:50"
  />,
];

const responsive = {
  0:{items:1},
  568:{items:2},
  1024:{items:3}
};

const createItems = (length, [handleClick]) => {
  let deltaX = 0;
  let difference = 0;
  const swipeDelta = 20;

  return Array.from({ length }).map((item, i) => (
      <div
          data-value={i + 1}
          className="item"
          onMouseDown={(e) => (deltaX = e.pageX)}
          onMouseUp={(e) => (difference = Math.abs(e.pageX - deltaX))}
          onClick={() => difference < swipeDelta && handleClick(i)}
      >
          <span className="item-inner" />
      </div>
  ));
};

const Carousel = () => {
  const carousel = useRef(AliceCarousel)(null);
  
  return [
    <AliceCarousel
      key="carousel"
      mouseTracking
      disableDotsControls
      disableButtonsControls
      items={items}
      ref={carousel}
    />,
    <nav key="nav" className="b-refs-navs">
      {items.map((item, i) => {
        return <span key={i} onClick={() => carousel?.current?.slideTo(i)} />;
      })}
    </nav>,
    <div key="btns" className="b-refs-buttons">
      <button onClick={(e) => carousel?.current?.slidePrev(e)}>Prev</button>
      <button onClick={(e) => carousel?.current?.slideNext(e)}>Next</button>
    </div>
  ]
};

export default function EventCarousel () {
  return (
    <>
    <div className='w-full h-[300px] '>
      <div className='bg-[#0A0A0A] w-full h-full mt-0'>
        <Carousel/>
        <div key="btns" className="b-refs-buttons">
          <button onClick={(e) => AliceCarousel?.current?.slidePrev(e)}>
          <svg width="52" height="52" viewBox="0 0 52 52" fill="none" xmlns="http://www.w3.org/2000/svg">
             <circle cx="26" cy="26" r="25.5" transform="rotate(-180 26 26)" fill="#0A0A0A" stroke="white"/>
             <path d="M16.5858 24.5858C15.8047 25.3668 15.8047 26.6332 16.5858 27.4142L29.3137 40.1421C30.0948 40.9232 31.3611 40.9232 32.1421 40.1421C32.9232 39.3611 32.9232 38.0948 32.1421 37.3137L20.8284 26L32.1421 14.6863C32.9232 13.9052 32.9232 12.6389 32.1421 11.8579C31.3611 11.0768 30.0948 11.0768 29.3137 11.8579L16.5858 24.5858ZM21 24L18 24L18 28L21 28L21 24Z" fill="white"/>
           </svg>
          </button>
          <button onClick={(e) => AliceCarousel?.current?.slideNext(e)}>
          <svg width="52" height="52" viewBox="0 0 52 52" fill="none" xmlns="http://www.w3.org/2000/svg">
             <circle cx="26" cy="26" r="25.5" fill="#0E0E0E" stroke="white"/>
             <path d="M36.4142 27.4142C37.1953 26.6332 37.1953 25.3668 36.4142 24.5858L23.6863 11.8579C22.9052 11.0768 21.6389 11.0768 20.8579 11.8579C20.0768 12.6389 20.0768 13.9052 20.8579 14.6863L32.1716 26L20.8579 37.3137C20.0768 38.0948 20.0768 39.3611 20.8579 40.1421C21.6389 40.9232 22.9052 40.9232 23.6863 40.1421L36.4142 27.4142ZM32 28L35 28L35 24L32 24L32 28Z" fill="white"/>
           </svg>
          </button>
        </div>
      </div>
    </div>
    </>
  );
}
